import WBK from 'wikibase-sdk';

export default function TornadoTable() {

    const wbk = WBK({ instance: 'http://156.35.98.107:8080' })
    const headers = { 'Accept': 'application/json' };

    var propertiesTornado = ['P1','P2','P3','P4','P5','P6','P7','P8','P9','P26','P27','P28'];

    //Q23
    var url = wbk.getEntities('Q23')
    var tornado = null;
    fetch(url, { headers }).then(body => { body.json().then(data => { tornado = data.entities.Q23.claims }); });

    propertiesTornado.forEach(function(prop) {
        console.log(tornado[prop])
    })

    var tornados = [{ title: '2021', state: 'Ohio' }, { title: '2022', state: 'Texas' }];

    var tornadosToShow = tornados.map(function (tornado) {
        return (
            <tr>
                <td>{tornado.title}</td>
                <td>{tornado.state}</td>
            </tr>
        )
    })

    return (
        <div>
            <div className='container col-md-8'>
                <table className="table table-dark">
                    <thead>
                        <tr>
                            <th scope="col">Nombre</th>
                            <th scope="col">Estado</th>
                        </tr>
                    </thead>
                    <tbody>
                        {tornadosToShow}
                    </tbody>
                </table>
            </div>
        </div>
    )
}
